-- | Convert to a matrix
type ThirtyTwo = Ten_and (Ten_and (Ten_and Two))
type SixtyFour = Ten_and (Ten_and (Ten_and (Ten_and (Ten_and (Ten_and Four)))))

omega17mat :: Matrix ThirtyTwo ThirtyTwo DOmega
omega17mat = matrix_of_rows omega17

-- | Two-level synthesis of \(\omega_{17}\)
twolevel_circuit :: [TwoLevel]
twolevel_circuit = synthesis_nqubit omega17mat

-- | Alternate method using reflections

-- Columns of U
uj :: [Matrix ThirtyTwo One DOmega]
uj = map (\xs -> matrix_of_columns [xs]) $ columns_of_matrix omega17mat

-- ket 0
ket0 :: Matrix Two One DOmega
ket0 = matrix_of_columns [[1, 0]]

-- ket 1
ket1 :: Matrix Two One DOmega
ket1 = matrix_of_columns [[0, 1]]

-- ket j
ketj :: Int -> Matrix ThirtyTwo One DOmega
ketj j = matrix_of_function (\a b -> if a == j then 1 else 0)

wjminus :: [Matrix SixtyFour One DOmega]
wjminus = map f $ zip [0..] uj where
  f :: (Int, Matrix ThirtyTwo One DOmega) -> Matrix SixtyFour One DOmega
  f (j, uj) = scalarmult (half*roottwo) (f1 (j, uj) .-. f2 (j, uj))
  f1 :: (Int, Matrix ThirtyTwo One DOmega) -> Matrix SixtyFour One DOmega
  f1 (j, uj) = tensor ket1 (ketj j)
  f2 :: (Int, Matrix ThirtyTwo One DOmega) -> Matrix SixtyFour One DOmega
  f2 (j, uj) = tensor ket0 uj

-- Circuits
cj :: [[TwoLevel]]
cj = map (\(j, wj) -> reduce_column wj j) $ zip [0..] wjminus

-- Reflections
rj :: [[TwoLevel]]
rj = map (\cj -> cj ++ [TL_omega 4 31] ++ invert_twolevels cj) cj

tcount :: TwoLevel -> Int
tcount (TL_X _ _) = 36
tcount (TL_H _ _) = 36
tcount (TL_T _ _ _) = 53
tcount (TL_omega _ _) = 53

main :: IO ()
main = do
  --putStrLn $ "Circuit for omega17: " ++ show (concat rj)
  putStrLn $ "Circuit length for omega17: " ++ show (length $ concat rj)
  putStrLn $ "T-count for omega17: " ++ show (sum $ map tcount $ concat rj)
